css:
@-webkit-keyframes flash {
  from {
    background: #2aa198;
  }
  to {
    background: none;
  }
}
.editor-colors,
:host {
  background-color: #202121;
  color: #e5e7e7;
}
.editor .invisible-character,
:host .invisible-character,
.editor .indent-guide,
:host .indent-guide {
  color: rgba(176, 182, 182, 0.2);
}
.editor .gutter,
:host .gutter {
  background-color: #282929;
}
.editor .gutter .line-number,
:host .gutter .line-number {
  opacity: 0.5;
}
.editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
.editor .gutter .line-number:after,
:host .gutter .line-number:after,
.editor .fold-marker:after,
:host .fold-marker:after {
  color: #d33682;
}
.editor .cursors.blink-off .cursor,
:host .cursors.blink-off .cursor {
  visibility: visible !important;
  border-left: 1px solid #2d2e2e;
}
.editor .selection .region,
:host .selection .region {
  background-color: rgba(220, 50, 47, 0.2);
}
.editor .line-number.cursor-line-no-selection,
:host .line-number.cursor-line-no-selection {
  background-color: #54544d;
}
.bracket-matcher {
  background-color: #e0e8e8;
  opacity: 0.2;
}
.comment {
  color: rgba(229, 231, 231, 0.5);
}
.entity {
  color: #f92672;
}
.keyword {
  color: #f92672;
  font-weight: bold;
}
.storage {
  color: #66d9ef;
}
.storage.type {
  color: #859900;
}
.constant {
  color: #ae81ff;
}
.constant.numeric,
.constant.boolean {
  color: #ae81ff;
}
.variable {
  color: #fd971f;
}
.delimiter,
.brace {
  color: #e5e7e7;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #dc322f;
}
.invalid.illegal {
  color: #dc322f;
}
.string {
  color: #e6db74;
}
.string .constant.character.escape {
  color: #dc322f;
}
.string.regexp {
  color: #2aa198;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #dc322f;
}
